/**
 * @param {number[]} hours
 * @param {number} target
 * @return {number}
 */
var numberOfEmployeesWhoMetTarget = function(hours, target) {
    // Initialize a counter to track the number of employees meeting the target
    let count = 0;

    // Iterate through the hours array
    for (let i = 0; i < hours.length; i++) {
        // If the current employee's hours are greater than or equal to the target,
        // increment the counter
        if (hours[i] >= target) {
            count++;
        }
    }

    // Return the final count of employees who met or exceeded the target hours
    return count;
};
